import  classes from './button.module.css'

export default function Button({ 
    type,
    text,
    onClick,
    color,
    backgroundColor,
    fontSize,
    width,
    height,

}){
    return (
        <div className={classes.container}>
        <button
            type={type}
            onClick={onClick}
            style={{
                backgroundColor,
                color,
                fontSize,
                width,
                height,
            }}


        >
            {text}
        </button>
        </div>
    )
}

Button.defaultProps = ({
    type: 'button',
    text: 'Submit',
    onClick: () => {},
    color: '#333',
    backgroundColor: '#fff',
    fontSize: '1.3rem',
    width: '12rem',
    height: '3.5rem',
})
